import { Link } from 'react-router-dom';
import '../style/nav.scss';


export default function Navigation() {
    return (
        
        <nav className='nav'>
            <div></div>
            <Link to="/" className='link'>
            <p>Acceuil</p>
            </Link>
            <Link to="/src/pages/About" className='link'>
            <p>A propos</p>
            </Link>
        </nav>
    )
};
